INSERT INTO `events` VALUES ('7cd5b0b1-1c77-4601-960b-010a8bf35db9','5f328047-946f-4c83-b015-b668b81eeb57','Mozambique Arts & Music Festival 2025','Celebrate Mozambique’s vibrant culture with a day of live music, traditional dance, local crafts, and food stalls. Performances from top Mozambican artists and special international guests.','Workshop','09b83342-06d9-4d82-a53f-413e7218e9fb','f53771b3-3c1d-4ae6-a643-e994434bc343','2025-10-11 10:00:00','2025-10-11 21:00:00','Africa/Dakar','In-Person','Mozambique','Maputo','Maputo, Matola',NULL,'Free',NULL,NULL,200,'2025-09-24 23:59:00',NULL,NULL,'approved','2025-09-23 23:58:59','2025-10-23 08:14:25',NULL,'a687455e-d483-468c-bb00-a85bdf179321',NULL,NULL,NULL,NULL,NULL,NULL),('90d464bf-6610-4ea9-b9ea-684af5125099','5f328047-946f-4c83-b015-b668b81eeb57','Testing event...','Describe your event: Join us for a day of networking and learning about the latest marketing trends. Featuring industry experts and hands-on workshops.','Workshop',NULL,NULL,'2025-10-21 20:43:00',NULL,'Africa/Lagos','In-Person','All countries',NULL,NULL,NULL,'Free',NULL,NULL,NULL,NULL,'cover-1760553736354-855768109.jpg',NULL,'suspended','2025-10-15 18:42:17','2025-10-23 08:14:25',NULL,'a687455e-d483-468c-bb00-a85bdf179321','f02ca91d-f5fe-4b47-8cdd-84892d156f22',NULL,NULL,NULL,NULL,NULL),('c73cc57a-4809-49a1-a1ba-42d9fb2e820e','546ffe20-80a8-410f-baa9-b17f19f1812f','The wind industry’s technical community met in Istanbul to boost wind power yields','To make wind energy a success in Europe, hundreds of technicians, operators and innovators across the industry are pushing for new ways to better assess our wind resource and to improve our analysis of operating wind farms. In this way we can break new records and boost our yields as Europe shifts to net-zero.\n\nAt WindEurope’s Technology Workshop 2025, we got to hear the latest viewpoints from people working on resource assessment and operating wind farms analysis. 450+ experts from Europe and elsewhere came to share insight, tackle challenges, and to boost ties across the wind industry’s technical community.','Workshop','543cc7a5-4aa7-4abb-9e43-2fc5490b9cf2',NULL,'2025-09-30 20:36:00','2025-09-30 22:37:00','Africa/Maputo','Hybrid','South Africa','Johannesburg','Johannesburg, South Africa',NULL,'Free',NULL,NULL,NULL,'2025-09-23 23:59:00','data:image/jpeg;base64,','https://kaziwani-server.visum.co.mz/api/uploads/events/b7a58e49-805f-4896-aedd-7b8e55766a41.jpeg','suspended','2025-09-23 18:43:55','2025-10-23 08:14:25',NULL,'a687455e-d483-468c-bb00-a85bdf179321','8a88a71d-6aff-4fa9-a2a0-ae3c863c194b',NULL,'047b7190-24e3-4ad5-bd05-77fc08011ca4','642a74e7-fc2b-4cd7-9719-ead58eba5b23',NULL,NULL);
