INSERT INTO `jobs` VALUES ('0eb9c4de-d0fb-49ce-bf45-81ea6a81111f','Social media management ','MecuryX','73cd9417-be09-416f-8def-87247312ee67',0,'',NULL,'','','','','','<p>We’re looking for a creative and organized <strong>Social Media Manager</strong> to handle our online presence across key platforms. You’ll be responsible for creating engaging content, managing posts, monitoring engagement, and growing our brand’s community online.</p>','[]','','',NULL,NULL,'USD','',NULL,1,'','','73cd9417-be09-416f-8def-87247312ee67',NULL,NULL,'published','approved',NULL,'2025-10-19 00:56:43','2025-10-23 08:14:24',NULL,NULL,NULL,NULL,'[]','9bb1d8ee-d8b6-49a2-9cfe-fe49f19b4a8f','ec12c307-36b4-4f9f-8db9-3e409c4a7035',NULL,NULL),('26c1864f-f4bf-41fc-ac48-c1f586b90d05','Trainers','Panafrican Business Initiative ','c78efbe5-4854-47c4-8b20-1bdfd287cce2',0,'Training',NULL,'Part-Time','Remote','Flexible Hours','Senior-Level','Hourly Jobs','<p>We are looking for business skills trainers to run online entrepreneurship workshops across Africa. Join us as we shape the new generations on change makers.</p>','[\"Facilitation skills\", \"Marketing\", \"Finance\"]','','',NULL,NULL,'USD','','2025-10-05',1,'Fill the form and attached CV and other supporting documents','','c78efbe5-4854-47c4-8b20-1bdfd287cce2','5ca14ae3-e4c8-4bdf-a2aa-1e6cdbefe732',NULL,'published','suspended',NULL,'2025-10-03 08:35:10','2025-10-23 08:14:24',NULL,'453fcc1e-2eda-4f54-9cf5-9d59d19d3a03','b3a44821-e82c-4104-941d-7256fe43f775',NULL,'[{\"city\": \"\", \"country\": \"Angola\"}]',NULL,NULL,NULL,NULL),('b41fd3a8-6457-4a70-8701-75fd6a63dadb','Video Editor & Animator Needed','Acllas','5f328047-946f-4c83-b015-b668b81eeb57',0,'',NULL,'','','','','','<p>We’re looking for a talented video editor/animator who can create an animated product demo video similar in style to the reference video.</p><p><br></p><p><strong>Requirements:</strong></p><ul><li>Produce a 60–90 second explainer/demo video for Our compnay.</li><li>Replicate the animation style, motion graphics, and transitions from the reference.</li><li>Add background music, sound effects, and optional voice-over.</li><li>Deliver a polished, professional, and engaging final video.</li></ul><p><br></p><p><strong>Ideal skills:</strong></p><ul><li>Strong experience in SaaS/product explainer videos.</li><li>Proficiency in After Effects, Premiere Pro, or similar tools.</li><li>Ability to bring creative visuals and storytelling to life.</li><li>Please include your portfolio or examples of previous videos showing similar animation styles.</li></ul>','[]','Afghanistan','',0.00,0.00,'USD','',NULL,1,'','','5f328047-946f-4c83-b015-b668b81eeb57','d74a318d-f86e-48fd-815f-26b12097a01e',NULL,'published','approved',NULL,'2025-10-20 15:59:27','2025-10-23 08:14:24',NULL,NULL,NULL,NULL,'[{\"city\": null, \"country\": \"All countries\"}]','9bb1d8ee-d8b6-49a2-9cfe-fe49f19b4a8f','6d3f5a16-c43f-4eaf-b31b-d15eded3aacc',NULL,'https://54links.s3.eu-north-1.amazonaws.com/videos/video-1760976391411-878612259.mp4'),('f8ba46f5-47f7-46f5-a705-74ca179a1867','Digital Marketing Manager','TechInnovate Solutions',NULL,0,'Marketing',NULL,'Part-Time','On-Site','Rotational Shifts','Entry-Level','Commission-Based','We need a Digital Marketing Manager to design and execute online campaigns across multiple platforms. The candidate will be responsible for SEO, social media management, paid ads, and email campaigns. Experience with African markets is a strong plus.','[\"SEO/SEM expertise\", \"Meta & Google Ads campaign management\", \"Strong writing and storytelling skills\", \"Familiarity with HubSpot or Mailchimp\"]','Mozambique','Maputo',100.00,400000.00,'USD','','2025-10-11',1,'Interested candidates should apply via our portal or email marketing@panafrica-retail.com\n. Include a short cover letter explaining why you’re passionate about African e-commerce.','marketing@panafrica-retail.com','5f328047-946f-4c83-b015-b668b81eeb57','543cc7a5-4aa7-4abb-9e43-2fc5490b9cf2','f94bd642-7b