lls. I help businesses stay organized, responsive, and efficient.',NULL,'Mid','[]','[]',1,'2025-10-18 16:27:29','2025-10-23 08:14:25',NULL),('1265fd78-4812-46b2-8ea4-5d258a2f4584','dc350c04-2ed2-4162-b82b-069cafe5b63d',NULL,NULL,NULL,1,1,1,1,'2000-09-22','Web Developer','Full-stack developer turning ideas into powerful, user-centered digital products.',NULL,'Director','[\"JavaScript\"]','[{\"name\": \"Portuguese\", \"level\": \"Native\"}, {\"name\": \"English\", \"level\": \"Native\"}]',1,'2025-09-22 18:36:18','2025-10-23 08:14:25',NULL),('1576316e-33bf-4d98-a92b-bca6a877aafb','ed14527a-58e4-4bd8-84c0-3c7216d75d89',NULL,NULL,NULL,1,1,1,1,'1993-11-18',' Customer service representative/ Virtual assistant/ sales representative ','I’m a reliable and organized Virtual Assistant and Customer Service Representative with a strong focus on efficiency and client satisfaction. I excel at managing administrative tasks, handling customer inquiries, scheduling, and ensuring smooth daily operations. With excellent communication skills and attention to detail, I’m committed to providing top-quality support that helps businesses build strong customer relationships and stay productive.',NULL,NULL,'[]','[]',1,'2025-10-18 23:21:41','2025-10-23 08:14:25',NULL),('23097fbc-d46c-4acb-aa12-942d986adb4e','4e6b6940-f99d-4bc0-84b0-076521227389',NULL,NULL,NULL,0,0,0,0,NULL,NULL,NULL,NULL,NULL,'[]','[]',0,'2025-10-16 09:17:02','2025-10-23 08:14:25',NULL),('2a1fc926-d8f2-4df1-a895-b72b6ea92062','538371d6-3180-461c-991d-9047dd360e8c',NULL,NULL,NULL,1,1,1,1,'1994-05-30','Project Manager ','I am a dynamic project manager who transform vision to impact. I specialized in leading high-impact initiative from strategy to successfully execution. My expertise span from program design, coordination and stakeholder engagement, I lead Innovative projects that empower people and create measurable change. I am passionate about youths and Africa development. I bring clarity, structure and purpose to every projec