-10-23 08:14:25',NULL),('43d82075-d90e-4879-8c54-33b8c34ab566','da769019-3205-4cdd-8592-415c02c4415a',NULL,NULL,NULL,1,1,1,1,'1996-06-03','IT support/ Customer Service Representative','I am an IT Support and Customer Service professional with over 2 years of experience providing technical assistance and ensuring seamless user operations in financial organization. I am Skilled in troubleshooting hardware, software, and network issues, I offer remote support using TeamViewer, AnyDesk, and Remote Desktop, and manage service requests through Zendesk. I’m proficient with Microsoft 365 Admin Center for user and device management, and committed to delivering efficient solutions, clear communication, and exceptional customer service. I’m currently seeking an opportunity to apply my skills in an IT Support or Customer Service role where I can contribute to smooth operations and user satisfaction.',NULL,NULL,'[]','[]',1,'2025-10-01 12:34:42','2025-10-23 08:14:25',NULL),('4611253c-5876-4a2a-a233-93307ce87f4c','04d015d7-ab2e-4c4c-950d-f5937ce23999',NULL,NULL,NULL,1,1,1,1,'2001-12-21','Chef','I cook and deliver worldwide',NULL,NULL,'[]','[]',0,'2025-09-24 08:12:18','2025-10-23 08:14:25',NULL),('4a6457fb-4e83-4b9d-8d45-5d1bbd536807','73cd9417-be09-416f-8def-87247312ee67',NULL,NULL,NULL,1,1,1,1,NULL,'Tech school','we teach students ',NULL,NULL,'[]','[]',0,'2025-10-16 09:38:20','2025-10-23 08:14:25',NULL),('4cedae32-134c-4847-8f2c-0ff24f4bc5b9','a146878f-fefc-42f3-aadd-a06ad954b8d1',NULL,NULL,NULL,0,0,0,0,NULL,NULL,NULL,NULL,NULL,'[]','[]',0,'2025-10-18 19:30:43','2025-10-23 08:14:25',NULL),('579a6d00-5186-4623-8bbb-99dbd50700cc','2a1b2e4a-3412-46bc-8b94-e99799dce945',NULL,NULL,NULL,1,1,1,1,NULL,'Digital Marketer | Social Media Expert | Meta Ad Expert ','Digital Marketer and a social media manager',NULL,NULL,'[]','[]',0,'2025-10-15 18:14:46','2025-10-23 08:14:25',NULL),('58e3a2db-5517-4e3d-90a0-0a22f5d4887a','7d0a714b-48a2-4ec6-bfe5-89aea350af54',NULL,NULL,NULL,1,1,1,1,'2004-03-01'