DROP TABLE IF EXISTS `users`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `users` (
  `id` char(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL,
  `name` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `phone` varchar(255) DEFAULT NULL,
  `biography` text,
  `nationality` varchar(255) DEFAULT NULL,
  `country` varchar(255) DEFAULT NULL,
  `city` varchar(255) DEFAULT NULL,
  `countryOfResidence` varchar(255) DEFAULT NULL,
  `gender` enum('male','female','other','prefer-not-to-say') DEFAULT NULL,
  `webpage` varchar(255) DEFAULT NULL,
  `passwordHash` varchar(255) NOT NULL,
  `accountType` enum('individual','company','admin') NOT NULL DEFAULT 'individual',
  `isVerified` tinyint(1) DEFAULT '0',
  `provider` enum('local','google') NOT NULL DEFAULT 'local',
  `googleId` varchar(64) DEFAULT NULL,
  `avatarUrl` longtext,
  `createdAt` datetime NOT NULL,
  `updatedAt` datetime NOT NULL,
  `address` varchar(255) DEFAULT NULL,
  `otherCountries` json DEFAULT NULL,
  `coverImage` longtext,
  PRIMARY KEY (`id`),
  UNIQUE KEY `users_email` (`email`),
  UNIQUE KEY `users_google_id` (`googleId`),
  KEY `users_country_of_residence` (`countryOfResidence`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
